import React from 'react';
import { useState, useEffect } from 'react';

const Roster = () => {
    return (
        <section className = "roster-container">
        {
            puppies.length ? puppies.map((singlePuppyElement) => {
                return (
                    <div key={singlePuppyElement.id}>
                        <div className = "dog-container">
                            <p className= "dog-id">Name: {singlePuppyElement.name} ID: #{singlePuppyElement.id}</p>
                            {/* <p>Puppy Breed: {singlePuppyElement.breed}</p> */}
                            {/* <img style={{
                                width: "75px",
                                height: "75px"
                            }} src={singlePuppyElement.imageUrl}></img> */}

                            {/* Need to get the url for the image of the current  */}
                            <img src="https://i.natgeofe.com/n/4f5aaece-3300-41a4-b2a8-ed2708a0a27c/domestic-dog_thumb_4x3.jpg" width="100"/>
                        </div>
                    </div>
                )
            }) : <div>No data yet, still loading...</div>
        }
     </section>
    )
}
export default Roster;
